/* The main.js file of thie axon-logo repo: 

Using the axonal anatomy of the retinal nerve fiber layer, 
we can make some pretty cool visualizations! 

The data object, bundleData, is generated via the Python script, AxonalPointsScript.py, 
which outputs a JSON object to a file I've named fiber_points.json. 

Importing the JSON in-browser was a bit of a hassle, so I just copy it's contents, 
and paste it below. A super long line of code, but this isn't going to production anytime soon, 
hence no need to optimize (yet!)

Basically, we take the points in the data object and use them to construct arrangements of spheres, 
varying their size and color according to angular/radial location. Each bundle is associated with
an initial angular 'launch' position. It then radially arcs across the nerve fiber layer. That 
is what we are visualizing here! 
*/

