// Making individual bundles: 
AFRAME.registerComponent('bundle',{
	//Our schema: 
	schema: {
		x_vals:{default:[]},  
		y_vals:{default:[]}, 
		r_vals:{default:[]},
		hex_color:{default:""},
		flipped:{default:false}
	},
	// Intitalize it! 
	init:function(){
		for(let i=1; i<this.data.x_vals.length; i++){
			// Okay, let's define some object params: 
			var radius = this.data.r_vals[i]
			var x_position = this.data.x_vals[i]
			var y_position = this.data.y_vals[i]
			// And make a spherical object: 
			var sphereObj = document.createElement('a-entity')
			sphereObj.setAttribute('geometry',{primitive:'sphere',radius:Math.log(radius/120+1.05)})
			sphereObj.setAttribute('material',{metalness:0.6,color:this.data.hex_color})
			sphereObj.setAttribute('position',{x:x_position,y:y_position,z:0})
			this.el.appendChild(sphereObj)
		}
	}
})

// Our scene
AFRAME.registerComponent('axonscene',{
	// Our constructor:
	init: async function(){
		// Building the scene via going through the data object: 
		this.bundleGrouper = AFRAME.utils.bind(this.bundleGrouper,this); 
		// First by superior and inferior:
		this.bundleGrouper(bundleData['superior'],'superior')
		this.bundleGrouper(bundleData['inferior'],'inferior')
		this.el.setAttribute('position',{x:0,y:0,z:-20});
		// For exporting a gltf file of our worK:
		document.addEventListener('keydown', function(event) {
			if (event.keyCode === 71) {
			  // Export to GTF (g)
			  console.log('exporting boxybox')
			  var drawing = document.querySelector(this.el.id);
			  // console.log(this.el.sceneEl)
			  console.log(drawing)
			  var sceneEl = document.querySelector('#master')
			  console.log(sceneEl)
			  sceneEl.systems['gltf-exporter'].export(drawing);
			}
		});
	}, 
	bundleGrouper: function(bundleObject,supInf){
		// And here we go through bundle by bundle:
		for(let i=0; i<bundleObject['angles'].length; i++){
			var bundle = document.createElement('a-entity');
			var xvals = bundleObject['x'][i]
			var yvals = bundleObject['y'][i]
			var rvals = bundleObject['r'][i]
			var colorIndex = Math.abs((bundleObject['angles'][i] - Math.min(...bundleObject['angles']))/( Math.max(...bundleObject['angles'])-Math.min(...bundleObject['angles'])))
			var cc = new THREE.Color(); 
			if(supInf == 'superior'){
				var color = cc.setRGB(1-colorIndex,1-colorIndex,1);
			}
			else{
				var color = cc.setRGB(colorIndex,colorIndex,1);
			}
			bundle.setAttribute('bundle',{x_vals:xvals,y_vals:yvals,r_vals:rvals,hex_color:color})
			this.el.appendChild(bundle)
		}
	}
})
